import React from "react";

const Footer = () => {
    return (
        <div style={{backgroundColor: "antiquewhite", textAlign: "center"}}>
            <footer className="footer">
            <p>&copy; 2024 Smart Receipt. All rights are reserved.</p>
        </footer>
        </div>
    );
};

export default Footer;
